public class Solution {
    public int MinimizeConcatenatedLength(string[] words) {
        int n = words.Length;
        var dp = new int[n, n];

        // Initialize dp array
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                dp[i, j] = int.MaxValue;
            }
        }

        for (int i = 0; i < n; i++) {
            dp[i, i] = words[i].Length;
        }

        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                for (int k = i; k < j; k++) {
                    int cost = dp[i, k] + dp[k + 1, j];
                    if (words[k].EndsWith(words[j][0])) cost--;
                    if (words[i][words[i].Length - 1] == words[k + 1][0]) cost--;
                    dp[i, j] = Math.Min(dp[i, j], cost);
                }
            }
        }

        int result = int.MaxValue;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                result = Math.Min(result, dp[i, j]);
            }
        }
        return result;
    }
}
